for (var i=0;i<area_v.legend_data.length;i++) {
    _s = area_v.legend_data[i];
    (function(k){
        $("#mgrs").append("<button id=\""+k+"_btn\" style=\"position: fixed;\">&gt;</button><ul id=\""+k+"_ul\"><span id=\""+k+"\">"+k+"</span></ul>");
        $("#"+k+"_ul").append(add_mgrs(k));//将 mgr 的 li 填入 area ul
        var inner_mgrs_list = eval("mgrs_v."+k+".legend_data")//区长列表
        // 遍历该区的所有区长
        for (var i=0;i<inner_mgrs_list.length;i++) {
            (function(x){
                $("#"+x).click(function(){
                    myChart.clear();
                    myChart.setOption(get_option(eval("tls_v."+x)));
                    myBarChart.clear();
                    myBarChart.setOption(get_bar_option(eval("databar_tl."+x)));
                });
            }(inner_mgrs_list[i]));
        };
        $("#"+k+"_btn").click(function(){
            $("#"+k+"_ul li").toggle(function(){
                $("#"+k+" ul").hide();
            },
            function(){
                $("#"+k+" li").show();
            })
        });
        $("#"+k).click(function(){
            myChart.clear();
            console.log(k);
            myChart.setOption(get_option(eval("mgrs_v."+k)));
            myBarChart.clear();
            myBarChart.setOption(get_bar_option(eval("databar_mgr."+k)));
        });
    }(_s));
}
// 添加 一个 area 的 mgr <li>的函数
function add_mgrs(area_name) {
    var s = "";
    var inner_mgrs_list = eval("mgrs_v."+area_name+".legend_data")//区长列表
    // 遍历该区的所有区长

        s += "<li id=\""+inner_mgrs_list[i]+"\">"+inner_mgrs_list[i]+"</li>";
